


update order_product set product_name = (select product_name from product where order_product.product_id = product.product_id);
update order_product set price = (select price from product where order_product.product_id = product.product_id);
update order_product set product_type = (select product_type from product where order_product.product_id = product.product_id);	
delete from "order" where "order".order_id not in (select order_id from order_product);
update "order" set net_price = (select sum(price*quantity) from order_product where order_product.order_id = "order".order_id group by order_product.order_id);
update "order" set status = 'FINISHED', updated_at = created_at + interval '2 hours' where status != 'CANCELED';
