INSERT INTO "product" (product_name , product_type , price , image_url , description , created_at) VALUES ('海軍風コーヒー' , 'NON_COFFEE' , 239 , 'image_4.JPEG' , 'アラビカ種 病害虫や霜、少雨等に弱く栽培が困難だが、風味とコクに優れ、レギュラーコーヒー用を主体とし多様な品種がある。総生産量の約70%を占める[8]。 従来は、ブラジルのブルボンとコロンビアのティピカが、アラビカ種の2大品種と呼ばれ主力品種だった。その後、収量や耐病虫性に優れた品種への置換が進み、最近[いつ?]ではブラジルのカトゥーラ、カトゥアイとムンド・ノーボ、コロンビアのカトゥーラとバリエダ・コロンビアが、それぞれ主力品種となっている。 このほか、スマトラ、モカ（銘柄とは別）、ブルー・マウンテン（ブランドとは別）、コナ、マラゴジッペ、アマレロ、ゲイシャなどがある。 ' , '2017-05-16') , ('ベトナムコーヒー' , 'NON_COFFEE' , 364 , 'image_6.JPEG' , 'キリマンジャロ（タンザニア） タンザニア産のコーヒーの日本での呼称。強い酸味とコクが特長。「野性味あふれる」と評されることが多い。深い焙煎では上品な苦味主体で浅 - 中煎りとは違った風味が楽しめる。 ' , '2016-10-23') , ('コスタリカ' , 'NON_COFFEE' , 414 , 'image_10.JPEG' , 'グアテマラ 酸味とコクに優れ、香気も' , '2016-10-27') , ('コスタリカ' , 'PURE_COFFEE' , 207 , 'image_6.JPEG' , 'ブルーマウンテン（ジャマイカ） 卓越した香気を持ち、調和の取れた味わい、軽い口当りと滑らかな咽越しが特徴。最高級の品質と呼ばれる。ジャマイカで生産されるコーヒーのうちごく一部の産地のものがブルーマウンテンとブランド付けられる。その中でもさらにランク付けがなされる[14]。 ' , '2017-07-29') , ('インディアンコーヒー' , 'FROM_COFFEE' , 461 , 'image_6.JPEG' , 'グアテマラ 酸味とコクに優れ、香気も' , '2018-05-18') , ('コロンビア式コーヒー' , 'PURE_COFFEE' , 484 , 'image_5.JPEG' , 'モカ（イエメン、エチオピア） 香気に優れ独特の酸味を持ち、甘みとコクが加わる。もっとも古い「ブランド」である。コーヒー原産地であり、イタリアなどではコーヒーのことをモカと呼ぶ。イエメン産の「マタリ」[15]、エチオピア産の「ハラー」、「シダモ」等が有名[16]。 ' , '2016-08-18') , ('ウィンナ・コーヒー' , 'PURE_COFFEE' , 385 , 'image_6.JPEG' , 'リベリカ種 高温多湿の気候に適応するが病害に弱く、品質もアラビカ種に及ばない。 ' , '2018-07-01') , ('キリマンジャロ' , 'NON_COFFEE' , 380 , 'image_8.JPEG' , 'アラビカ種 病害虫や霜、少雨等に弱く栽培が困難だが、風味とコクに優れ、レギュラーコーヒー用を主体とし多様な品種がある。総生産量の約70%を占める[8]。 従来は、ブラジルのブルボンとコロンビアのティピカが、アラビカ種の2大品種と呼ばれ主力品種だった。その後、収量や耐病虫性に優れた品種への置換が進み、最近[いつ?]ではブラジルのカトゥーラ、カトゥアイとムンド・ノーボ、コロンビアのカトゥーラとバリエダ・コロンビアが、それぞれ主力品種となっている。 このほか、スマトラ、モカ（銘柄とは別）、ブルー・マウンテン（ブランドとは別）、コナ、マラゴジッペ、アマレロ、ゲイシャなどがある。 ' , '2017-06-22') , ('グリーン・コーヒー' , 'NON_COFFEE' , 436 , 'image_10.JPEG' , 'コナ（ハワイ島） 非常に強い酸味とコク・風味を持つ。ブレンドに用いると良質な酸味が与えられるといわれる。ブルーマウンテンに次ぐブランドで高価である。 ' , '2016-11-29') , ('ケニア' , 'FROM_COFFEE' , 239 , 'image_2.JPEG' , 'モカ（イエメン、エチオピア） 香気に優れ独特の酸味を持ち、甘みとコクが加わる。もっとも古い「ブランド」である。コーヒー原産地であり、イタリアなどではコーヒーのことをモカと呼ぶ。イエメン産の「マタリ」[15]、エチオピア産の「ハラー」、「シダモ」等が有名[16]。 ' , '2018-07-12');
